import React from 'react';

const BlogPost = ({ post }) => {
    return (
        <div>
            <h1>{post.title}</h1>
            <p>{post.content}</p>
            <p>Author: {post.author}</p>
            <p>Published on: {new Date(post.createdAt).toLocaleDateString()}</p>
        </div>
    );
};

export default BlogPost;
